I'll go point by point:

- i don't know what you mean by "effectively upsizing/downsizing an array" because arrays in java have immutable length...

- a value is the actual data (e.g. 5, "abc" or an actual instantiation of an object). a reference "points to" the data beneath it (object variables in java are always references). a variable is a way to refer to data while writing your code. In Java, variables are either a *value type* (int, float, byte, etc) or a *reference type* (Object, Array, String, HashMap, etc)... a variable of any reference type (basically, a variable for any Object or Object subclass) is actually a *reference to the underlying value* (essentially, it's an implicit *pointer* to the underlying data... it basically is an address that tells the computer where to go to find the data). Yes, this is confusing and yes, java is dumb.

-- Additionally, java passes *all* function parameters *by value*, which means they are copied to the function being called.  q: "But wait! how does this work for Objects like Arrays? does that mean the whole thing is copied??" a: the *reference* (which is the address of the underlying data) is copied, not the underlying data. This will become more clear when you take CS449 when they talk about pointers.

-- Don't worry too much about how the computer connects them yet, you'll learn more about that in 447 and 449. Essentailly with java though, the compiler will read your code and turn it into a set of machine independent instructions. These instructions are then read by the java runtime environment and are executed. Note that some other programming languages, such as scripting languages like Python, skip the compilation step and just are "interpreted" by their virtual machine and are run on the fly. Other *compiled* languages like C, C++, Rust and Go, will directly compile to the underlying machine code and run directly on the processor (through the OS) rather than through the java virtual machine.

- For Big O/runtime stuff, essentially what you're trying to do is generalize how much "work" it will take to run an algorithm on a set of data. There's many ways of doing it but you essentially want to look at how many times a loop will run or a recursive function will be called for an arbitrarily sized input. For example:

```java
/* this has O(n^2) complexity */
public void doSomething(int[] arr) {
  int n = arr.length;
  for (int i = 0; i < n; i++) {
    for (int j = 0; j < n; j++) {
      //do something  
    }    
  }
}

/* this has O(n) complexity */
public void doSomethingElse(int[] arr) {
  int n = arr.length;
  for (int i = 0; i < n; i++) {
    // do something
  }
}

/* assume arr is sorted, return the index of val or -1 if not found; this is O(lg(n)) because it keeps dividing the size it's looking at in half each time it executes through the loop */
public int binarySearch(int[] arr, int val) {
  int n = arr.length;
  int left = 0;
  int right = n - 1;
  while (left <= right) {
    int mid = (left + right) / 2;
    if (arr[mid] < val) {
      left = mid + 1;
    } else if (arr[mid] > val) {
      right = mid - 1;
    } else {
      return mid;
    }
  }
  return -1;
}
```
